import React from "react";
import Card from "./Card";
import { NavLink } from "react-router-dom";

const Cards = React.memo(({ title, toprated, trending, series, movies, type }) => {
  console.log("Cards.jsx render:", title);
  return (
    <div className="Trending">
      <div className="firstPart">
        <h3>{title}</h3>
        <NavLink className="view" to={`/${type}`}>View All</NavLink>
      </div>
      <div className="secondPart">
        <Card toprated={toprated} trending={trending} series={series} movies={movies} />
      </div>
    </div>
  );
});

export default Cards;
